import "./App.css";
import Main from "./screens/Main/Main";
import { Routes, Route, useHistory } from "react-router";
import Layout from "./components/Layout/Layout";

function App() {
  return (
    <div className="App">
      <Layout />

      <Routes>
        <Route path="/">
          <Main />
        </Route>
        <Route path="/">
          <></>
        </Route>
        <Route>
          <></>
        </Route>
      </Routes>
    </div>
  );
}

export default App;
